import Login from "../src/pages/login/Login";
import { useContext } from "react";
import { AuthContext } from "./context/AuthContext";

function App() {
    const {user} = useContext(AuthContext)
    return (
        <Router>
            <Routes>
                <Route exact path="/" element={user ? (<Home />) : (<Login />)} />
                </Routes>
        </Router>
    )
}

export default App;
